export const addLocation = (data) => 
{
   return {
        type: 'ADD_LOCATION',
        payload: data,
   }
}
export const deleteLocation = (id) => 
{
   return {
        type: 'DELETE_LOCATION',
        payload: id,
   }
}
export const addCurrentLocation = (id) => 
{
   return {
        type: 'ADD_CURRENT_LOCATION',
        payload: id,
   }
}
